INSERT INTO `creature_text` (`CreatureID`, `GroupID`, `ID`, `Text`, `Type`, `Language`, `Probability`, `Emote`, `Duration`, `Sound`, `BroadcastTextId`, `comment`) VALUES
(126832, 0, 0, 'Avast, ye bilge suckers!', 14, 0, 100, 0, 0, 98121, 0, 'Skycap\'n Kragg'),
(126832, 1, 0, 'Aaargh! Sharkbait, come about and blast their broadsides!', 14, 0, 100, 482, 0, 98126, 0, 'Skycap\'n Kragg'),
(126832, 2, 0, 'Well, looks like someone still ain\'t got their sea legs!', 14, 0, 100, 0, 0, 98119, 0, 'Skycap\'n Kragg'),
(126832, 3, 0, 'I\'ll scuttle yer hides!', 14, 0, 100, 0, 0, 98111, 0, 'Skycap\'n Kragg to Player'),
(126832, 4, 0, 'Ha Ha! Don\'t crack yer teacup!', 14, 0, 100, 0, 0, 98120, 0, 'Skycap\'n Kragg'),
(126832, 5, 0, 'Guess I... be off... ta the locker...', 14, 0, 100, 0, 0, 98123, 0, 'Skycap\'n Kragg to Player'),
(126845, 0, 0, 'En guard!', 14, 0, 100, 0, 0, 97245, 0, 'Captain Jolly'),
(126845, 1, 0, 'Surging steel!', 14, 0, 100, 0, 0, 97246, 0, 'Captain Jolly'),
(126845, 2, 0, 'Bury me with my blade...', 14, 0, 100, 0, 0, 97250, 0, 'Captain Jolly to Player'),
(126848, 0, 0, 'Nice... shot...', 14, 0, 100, 0, 0, 97241, 0, 'Captain Eudora to Player'),
(126983, 0, 0, 'Think you can stand against me, swine? Allow me to educate you.', 14, 0, 100, 0, 0, 97284, 0, 'Harlan Sweete to Player'),
(126983, 1, 0, 'Men! Acquaint these scallywags with our heavy guns.', 14, 0, 100, 0, 0, 97283, 0, 'Harlan Sweete'),
(126983, 2, 0, 'Inconceivable...', 14, 0, 100, 0, 0, 97286, 0, 'Harlan Sweete to Player'), -- BroadcastTextID: 93926 - 116757 - 116788
(129547, 0, 0, 'WE\'VE GOT OURSELVES A BRAWL!', 14, 0, 100, 53, 0, 0, 0, 'Blacktooth Knuckleduster to Player'),
(129732, 0, 0, 'Yer doom be at hand!', 14, 0, 100, 0, 0, 98129, 0, 'Skycap\'n Kragg to Sharkbait'),
(129732, 1, 0, 'Don\'t mind Sharkbait. He just needs ta... empty his hold!', 14, 0, 100, 0, 0, 98130, 0, 'Skycap\'n Kragg to Sharkbait'),
(129732, 2, 0, 'Bombs away!', 14, 0, 100, 0, 0, 98131, 0, 'Skycap\'n Kragg to Sharkbait'), -- BroadcastTextID: 33527 - 74032
(129732, 3, 0, 'Watch out below, ye barnacle-bottomed swine!', 14, 0, 100, 0, 0, 98132, 0, 'Skycap\'n Kragg to Sharkbait'),
(129788, 0, 0, '%s attempts to run away in fear!', 16, 0, 100, 0, 0, 0, 1150, 'Irontide Bonesaw'),
(130086, 0, 0, 'Gather \'round and place yer bets! We got a new set of vict-- uh... competitors! Take it away, Gurgthok and Wodin!', 14, 0, 100, 669, 0, 97266, 0, 'Davey \"Two Eyes\" to Player');
