INSERT INTO `creature_text`(`CreatureID`, `GroupID`, `ID`, `Text`, `Type`, `Language`, `Probability`, `Emote`, `Duration`, `Sound`, `BroadcastTextId`, `TextRange`, `comment`) VALUES (130090, 0, 0, 'That\'s your cue, landlubbers!', 12, 0, 0, 0, 0, 97267, 141262, 0, '');
INSERT INTO `creature_text`(`CreatureID`, `GroupID`, `ID`, `Text`, `Type`, `Language`, `Probability`, `Emote`, `Duration`, `Sound`, `BroadcastTextId`, `TextRange`, `comment`) VALUES (129350, 0, 0, 'Ouch! Why\'d you poke me? Oh, oh! Wake up, Wodin! We\'re on!', 12, 0, 0, 0, 0, 97269, 141263, 0, '');
INSERT INTO `creature_text`(`CreatureID`, `GroupID`, `ID`, `Text`, `Type`, `Language`, `Probability`, `Emote`, `Duration`, `Sound`, `BroadcastTextId`, `TextRange`, `comment`) VALUES (130090, 1, 0, 'C\'mon, say the things! Say the things!', 12, 0, 0, 0, 0, 97268, 141265, 0, '');
INSERT INTO `creature_text`(`CreatureID`, `GroupID`, `ID`, `Text`, `Type`, `Language`, `Probability`, `Emote`, `Duration`, `Sound`, `BroadcastTextId`, `TextRange`, `comment`) VALUES (129350, 1, 0, 'Ouch! Okay, okay! Gather \'round for a show of unbridled ferocity! Comin\' to you from parts unknown. The mysterious... the dangerous... the slightly unkempt... the band of smelly buccaneers!', 12, 0, 0, 0, 0, 97270, 141266, 0, '');
INSERT INTO `creature_text`(`CreatureID`, `GroupID`, `ID`, `Text`, `Type`, `Language`, `Probability`, `Emote`, `Duration`, `Sound`, `BroadcastTextId`, `TextRange`, `comment`) VALUES (129350, 2, 0, 'And entering the ring, we have the amazing... the incredible... the magnificent... the... what the? Really?', 12, 0, 0, 0, 0, 97271, 141275, 0, '');
INSERT INTO `creature_text`(`CreatureID`, `GroupID`, `ID`, `Text`, `Type`, `Language`, `Probability`, `Emote`, `Duration`, `Sound`, `BroadcastTextId`, `TextRange`, `comment`) VALUES (129350, 3, 0, 'It\'s a greased up pig? I\'m beginning to think this is not a professional setup. Oh well... grab the pig and you win.', 12, 0, 0, 0, 0, 97272, 141276, 0, '');
INSERT INTO `creature_text`(`CreatureID`, `GroupID`, `ID`, `Text`, `Type`, `Language`, `Probability`, `Emote`, `Duration`, `Sound`, `BroadcastTextId`, `TextRange`, `comment`) VALUES (129350, 4, 0, 'Well, look at that. They caught a pig. Maybe we should move on to a more... threatening challenge!', 12, 0, 0, 0, 0, 97273, 141340, 0, '');
INSERT INTO `creature_text`(`CreatureID`, `GroupID`, `ID`, `Text`, `Type`, `Language`, `Probability`, `Emote`, `Duration`, `Sound`, `BroadcastTextId`, `TextRange`, `comment`) VALUES (129350, 5, 0, 'From the sewers of Freehold comes a tortollan brigand who makes it his duty to \"turtley\" hurt you. He is the Dynamo of Defense... the Sergeant of Shell Shock... the Hellion in a Half-Shell... Ludwig!', 12, 0, 0, 0, 0, 97274, 141341, 0, '');
INSERT INTO `creature_text`(`CreatureID`, `GroupID`, `ID`, `Text`, `Type`, `Language`, `Probability`, `Emote`, `Duration`, `Sound`, `BroadcastTextId`, `TextRange`, `comment`) VALUES (129350, 6, 0, 'Ludwig goes down! What a fight! These smelly buccaneers are resilient, and they better be... because their next challenger is the epitome of brutality.', 12, 0, 0, 0, 0, 97275, 141344, 0, '');
INSERT INTO `creature_text`(`CreatureID`, `GroupID`, `ID`, `Text`, `Type`, `Language`, `Probability`, `Emote`, `Duration`, `Sound`, `BroadcastTextId`, `TextRange`, `comment`) VALUES (129350, 7, 0, 'Our champion that sleeps with the fishes... literally! The Freehold Fanatic... the Master of the Jagged Jawbone Jab... the Powerful Pugilist Predator... Trothak the Shark Puncher!', 12, 0, 0, 0, 0, 97279, 141351, 0, '');
INSERT INTO `creature_text`(`CreatureID`, `GroupID`, `ID`, `Text`, `Type`, `Language`, `Probability`, `Emote`, `Duration`, `Sound`, `BroadcastTextId`, `TextRange`, `comment`) VALUES (126832, 0, 0, 'Avast, ye bilge suckers!', 14, 0, 100, 0, 0, 98121, 0, 0, 'Skycap\'n Kragg');
INSERT INTO `creature_text`(`CreatureID`, `GroupID`, `ID`, `Text`, `Type`, `Language`, `Probability`, `Emote`, `Duration`, `Sound`, `BroadcastTextId`, `TextRange`, `comment`) VALUES (126832, 1, 0, 'Aaargh! Sharkbait, come about and blast their broadsides!', 14, 0, 100, 482, 0, 98126, 0, 0, 'Skycap\'n Kragg');
INSERT INTO `creature_text`(`CreatureID`, `GroupID`, `ID`, `Text`, `Type`, `Language`, `Probability`, `Emote`, `Duration`, `Sound`, `BroadcastTextId`, `TextRange`, `comment`) VALUES (126832, 2, 0, 'Well, looks like someone still ain\'t got their sea legs!', 14, 0, 100, 0, 0, 98119, 0, 0, 'Skycap\'n Kragg');
INSERT INTO `creature_text`(`CreatureID`, `GroupID`, `ID`, `Text`, `Type`, `Language`, `Probability`, `Emote`, `Duration`, `Sound`, `BroadcastTextId`, `TextRange`, `comment`) VALUES (126832, 3, 0, 'I\'ll scuttle yer hides!', 14, 0, 100, 0, 0, 98111, 0, 0, 'Skycap\'n Kragg to Player');
INSERT INTO `creature_text`(`CreatureID`, `GroupID`, `ID`, `Text`, `Type`, `Language`, `Probability`, `Emote`, `Duration`, `Sound`, `BroadcastTextId`, `TextRange`, `comment`) VALUES (126832, 4, 0, 'Ha Ha! Don\'t crack yer teacup!', 14, 0, 100, 0, 0, 98120, 0, 0, 'Skycap\'n Kragg');
INSERT INTO `creature_text`(`CreatureID`, `GroupID`, `ID`, `Text`, `Type`, `Language`, `Probability`, `Emote`, `Duration`, `Sound`, `BroadcastTextId`, `TextRange`, `comment`) VALUES (126832, 5, 0, 'Guess I... be off... ta the locker...', 14, 0, 100, 0, 0, 98123, 0, 0, 'Skycap\'n Kragg to Player');
INSERT INTO `creature_text`(`CreatureID`, `GroupID`, `ID`, `Text`, `Type`, `Language`, `Probability`, `Emote`, `Duration`, `Sound`, `BroadcastTextId`, `TextRange`, `comment`) VALUES (126832, 6, 0, 'Best be gettin\' yer wills in order!', 14, 0, 100, 0, 0, 98122, 140362, 0, '');
INSERT INTO `creature_text`(`CreatureID`, `GroupID`, `ID`, `Text`, `Type`, `Language`, `Probability`, `Emote`, `Duration`, `Sound`, `BroadcastTextId`, `TextRange`, `comment`) VALUES (126832, 7, 0, 'This one is goin\' right in yer deadlights!', 14, 0, 100, 0, 0, 98112, 140399, 0, '');
INSERT INTO `creature_text`(`CreatureID`, `GroupID`, `ID`, `Text`, `Type`, `Language`, `Probability`, `Emote`, `Duration`, `Sound`, `BroadcastTextId`, `TextRange`, `comment`) VALUES (126832, 8, 0, 'Ye won\'t soon be forgettin\' that taste.', 14, 0, 100, 0, 0, 98118, 140400, 0, '');
INSERT INTO `creature_text`(`CreatureID`, `GroupID`, `ID`, `Text`, `Type`, `Language`, `Probability`, `Emote`, `Duration`, `Sound`, `BroadcastTextId`, `TextRange`, `comment`) VALUES (126983, 2, 0, 'Inconceivable...', 14, 0, 100, 0, 0, 97286, 0, 0, 'Harlan Sweete to Player');
INSERT INTO `creature_text`(`CreatureID`, `GroupID`, `ID`, `Text`, `Type`, `Language`, `Probability`, `Emote`, `Duration`, `Sound`, `BroadcastTextId`, `TextRange`, `comment`) VALUES (126983, 1, 0, 'Men! Acquaint these scallywags with our heavy guns.', 14, 0, 100, 0, 0, 97283, 0, 0, 'Harlan Sweete');
INSERT INTO `creature_text`(`CreatureID`, `GroupID`, `ID`, `Text`, `Type`, `Language`, `Probability`, `Emote`, `Duration`, `Sound`, `BroadcastTextId`, `TextRange`, `comment`) VALUES (126983, 0, 0, 'Think you can stand against me, swine? Allow me to educate you.', 14, 0, 100, 0, 0, 97284, 0, 0, 'Harlan Sweete to Player');
